import React from "react";
import Header from '../components/Header';
import MainPostL from '../components/MainPostL';
import Footer from '../components/Footer';

const PostL=()=> {
  return (
    <div id="page-wrapper">
      <Header />
      <MainPostL />
      <Footer />
    </div>
  )
}
export default PostL;
